    if input_list == sorted(input_list):
        # Pattern where the list is in increasing order
        return 0
    if input_list == sorted(input_list, reverse=True):
        # Pattern where the list is in decreasing order
        return 0

    # Default case: find the first index where the pattern changes
    for i in range(1, len(input_list)):
        if input_list[i] != input_list[i - 1]:
